import {a,b,c,d,r,f,ff,ffff, fffff,ffffff,fffa, fffas, fffsda,fffsdaa
} from 'images/gallery/index'

export type GalleryItem = {
  src: string;
  alt: string;
  caption?: string;
};

export const gallery: GalleryItem[] = [
  { src: a, alt: 'Motor recondiționat, compartiment curat', caption: 'Recondiționare motor' },
  { src: b, alt: 'Schimb plăcuțe și discuri frână', caption: 'Frâne noi' },
  { src: c, alt: 'Service A/C – încărcare freon', caption: 'Climatizare' },
  { src: d, alt: 'Diagnoză computerizată – OBD', caption: 'Diagnoză OBD' },
  { src: r, alt: 'Diagnoză computerizată – OBD', caption: 'Diagnoză OBD' },
  { src: f, alt: 'Diagnoză computerizată – OBD', caption: 'Diagnoză OBD' },
  { src: ff, alt: 'Diagnoză computerizată – OBD', caption: 'Diagnoză OBD' },
  { src: ffff, alt: 'Diagnoză computerizată – OBD', caption: 'Diagnoză OBD' },
  { src: fffa, alt: 'Diagnoză computerizată – OBD', caption: 'Diagnoză OBD' },
  { src: fffas, alt: 'Diagnoză computerizată – OBD', caption: 'Diagnoză OBD' },
  { src: fffsdaa, alt: 'Diagnoză computerizată – OBD', caption: 'Diagnoză OBD' },
  { src: fffff, alt: 'Diagnoză computerizată – OBD', caption: 'Diagnoză OBD' },
  { src: ffffff, alt: 'Diagnoză computerizată – OBD', caption: 'Diagnoză OBD' },
  { src: fffsda, alt: 'Diagnoză computerizată – OBD', caption: 'Diagnoză OBD' },

];

export const galleryExtended: GalleryItem[] = Array(5)
  .fill(gallery)
  .flat();
